INSERT INTO `posts` (`id`, `author_id`, `title`, `description`, `content`, `date`) VALUES (1, 80, 'Expedita itaque distinctio tempora tempore illum.', 'Ipsum mollitia accusantium architecto ut. Quis dolorem cumque unde accusamus voluptatem. Dolor neque ea quo eveniet voluptatem eum ut. Repellat ut provident culpa itaque voluptates omnis. Dignissimos amet consequuntur asperiores corporis.', 'Aut odio animi iusto quidem est corporis distinctio. Enim minima ducimus ipsa expedita. Ex iusto consectetur illo quibusdam. Asperiores quisquam et quasi.', '1994-03-21');
INSERT INTO `posts` (`id`, `author_id`, `title`, `description`, `content`, `date`) VALUES (2, 37, 'Qui aut et velit dicta.', 'Atque soluta perferendis rerum. Nam recusandae voluptatem est.', 'Possimus ut dolorem cumque. Incidunt ipsam alias veniam ratione repudiandae maxime in. Aut aliquam id at aut facilis vitae et in. Ullam accusantium eos nobis omnis nostrum voluptas voluptatem.', '1999-09-18');
INSERT INTO `posts` (`id`, `author_id`, `title`, `description`, `content`, `date`) VALUES (3, 96, 'Quae dolorum eveniet fugit numquam.', 'Odit suscipit alias doloremque veritatis sunt deserunt quis animi. In tempora quia pariatur molestiae fugit. Suscipit quo nulla distinctio omnis. Aut qui voluptate voluptatem natus alias ut. Esse ea rerum sed ad sunt ut.', 'Numquam maxime et expedita labore. Quos natus aut libero assumenda porro porro autem. Consectetur odio ullam rerum ea dolor aspernatur sequi.', '1991-02-11');
INSERT INTO `posts` (`id`, `author_id`, `title`, `description`, `content`, `date`) VALUES (4, 21, 'Eos possimus quae quibusdam et.', 'Sit nam suscipit nostrum quaerat eum. Voluptas et rerum culpa totam omnis quia. Doloribus non fugit laborum nisi voluptatum nihil repudiandae. Accusantium et sint inventore enim aut cupiditate vitae. Quis sunt sit animi laboriosam earum ut.', 'Tempora voluptate culpa rerum. Est aperiam praesentium quaerat possimus. Cum assumenda tempore deserunt iste ipsam mollitia et.', '2001-07-23');
